import React, { useState } from "react";
import { FaSwimmer, FaFutbol, FaBasketballBall, FaTableTennis, FaMapMarkerAlt, FaCalendarAlt, FaSearch } from "react-icons/fa";

const SearchBar = () => {
  const [activity, setActivity] = useState("");
  const [location, setLocation] = useState("");
  const [date, setDate] = useState("");

  const handleSearch = () => {
    console.log("Recherche effectuée avec :", { activity, location, date });
    // Ajoutez ici la logique de recherche
  };

  // Liste des activités avec leurs icônes
  const activityIcons = {
    natation: <FaSwimmer className="text-blue-500 text-lg" />,
    football: <FaFutbol className="text-green-500 text-lg" />,
    basketball: <FaBasketballBall className="text-orange-500 text-lg" />,
    tennis: <FaTableTennis className="text-red-500 text-lg" />,
  };

  return (
    <div className="bg-white p-8 rounded-lg shadow-xl max-w-4xl mx-auto">
      <h2 className="text-2xl font-bold mb-6 text-gray-800">Rechercher un terrain</h2>
      <div className="flex flex-col md:flex-row gap-4 items-center">
        
        {/* Sélecteur d'activité avec icône à l'intérieur */}
        <div className="relative w-full md:w-1/4">
          <div className="absolute left-3 top-1/2 transform -translate-y-1/2">
            {activity ? activityIcons[activity] : <FaSearch className="text-gray-400 text-lg" />}
          </div>
          <select
            value={activity}
            onChange={(e) => setActivity(e.target.value)}
            className="border p-3 pl-10 rounded-lg w-full focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer appearance-none"
          >
            <option value="">Activité</option>
            <option value="natation">Natation</option>
            <option value="football">Football</option>
            <option value="basketball">Basketball</option>
            <option value="tennis">Tennis</option>
          </select>
        </div>

        {/* Sélecteur de localisation avec icône à l'intérieur */}
        <div className="relative w-full md:w-1/4">
          <div className="absolute left-3 top-1/2 transform -translate-y-1/2">
            <FaMapMarkerAlt className="text-red-500 text-lg" />
          </div>
          <select
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            className="border p-3 pl-10 rounded-lg w-full focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer appearance-none"
          >
            <option value="">Localisation</option>
            <option value="tunis">Tunis</option>
            <option value="ariana">Ariana</option>
            <option value="ben_arous">Ben Arous</option>
            <option value="mannouba">Manouba</option>
          </select>
        </div>

        {/* Sélecteur de date avec icône */}
        <div className="relative w-full md:w-1/4">
          <div className="absolute left-3 top-1/2 transform -translate-y-1/2">
            <FaCalendarAlt className="text-gray-500 text-lg" />
          </div>
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            className="border p-3 pl-10 rounded-lg w-full focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer"
          />
        </div>

        {/* Bouton de recherche */}
        <button
          onClick={handleSearch}
          className="bg-emerald-600 text-white px-6 py-3 rounded-lg hover:bg-emerald-500 transition-all duration-200 w-full md:w-auto flex items-center justify-center"
        >
          <FaSearch className="mr-2" /> Rechercher
        </button>
      </div>
    </div>
  );
};

export default SearchBar;
